import React from "react";
import styled from "styled-components";

const SideBar = () => {
  const SideContainer = styled.div`
    flex: 1.5;
    // background-color: red;
    padding: 20px;
  `;
  const Logo = styled.div`
    width: 100%;
    height: 100%;
  `;
  const LogoImg = styled.img`
    width: 100px;
  `;
  const SideList = styled.ul``;
  const SideItems = styled.li``;
  const UserName = styled.div``;
  const List = styled.span``;
  const ListNotify = styled.span``;

  return (
    <SideContainer>
      <Logo>
        <LogoImg src="/images/logo2.png"></LogoImg>
      </Logo>
      <SideList>
        <SideItems>
          <List></List>
          <ListNotify></ListNotify>
        </SideItems>
        <SideItems>My Post</SideItems>
        <SideItems>My Profile</SideItems>
        <SideItems>Liked Profiles</SideItems>
        <SideItems>Shortlisted Profiles</SideItems>
        <SideItems>Rejected Profiles</SideItems>
        <SideItems>Settings</SideItems>
      </SideList>
      <UserName></UserName>
    </SideContainer>
  );
};

export default SideBar;
